class T5PegasusTokenizer(BertTokenizerFast):

    def __init__(self, *args, **kwargs):
        super(T5PegasusTokenizer, self).__init__(*args, **kwargs)

    def _tokenize(self, text, *args, **kwargs):
        split_tokens = []
        for token in jieba.cut(text, HMM=False):
            if token in self.vocab:
                split_tokens.append(token)
            else:
                split_tokens.extend(super()._tokenize(token))
        return split_tokens


